selector_to_html = {"a[href=\"#live-code\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Live code<a class=\"headerlink\" href=\"#live-code\" title=\"Link to this heading\">#</a></h1><p>With live coding you can make your pages more interactive by adding live, executable code cells. This extension is already part of your TeachBooks book if you started from the template. If not, you can follow instructions <a class=\"reference external\" href=\"https://teachbooks.io/manual/features/live_code.html#setting-up-python-live-coding\">in the manual</a> to enable it. The template also includes a sample page with live code enabled, which you can find <a class=\"reference external\" href=\"https://teachbooks.io/template/some_content/text_and_code.html\">here for the website of the original template</a></p><p>With live code enabled, readers can run snippets directly in the browser, experiment with examples, and complete exercises in real time. This section will guide you through some of the main features available: additional cell tags have been developed that can be added to Python code cells in your book. These tags extend the <a class=\"reference external\" href=\"https://jupyterbook.org/en/stable/content/metadata.html\">existing Jupyter Book v1 tags</a> and allow you to control how cells behave when live execution is enabled.</p>", "a[href=\"#trying-the-custom-tags\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Trying the custom tags<a class=\"headerlink\" href=\"#trying-the-custom-tags\" title=\"Link to this heading\">#</a></h2><p>Now that you know how to create executable code cells, let\u2019s explore the different custom tags available and see examples of how each one can control the behavior of your code when live execution is enabled.</p>", "a[href=\"#available-custom-tags\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Available custom tags<a class=\"headerlink\" href=\"#available-custom-tags\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#auto-execute-page\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">auto-execute-page</span></code><a class=\"headerlink\" href=\"#auto-execute-page\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#thebe-init\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">thebe-init</span></code><a class=\"headerlink\" href=\"#thebe-init\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#creating-a-notebook\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Creating a notebook<a class=\"headerlink\" href=\"#creating-a-notebook\" title=\"Link to this heading\">#</a></h2><p>There are two ways you can try this exercise, depending on whether you have an IDE installed. If you don\u2019t know what an IDE is, or don\u2019t have one installed, follow Option 2 below.</p>", "a[href=\"#disable-execution-cell\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">disable-execution-cell</span></code><a class=\"headerlink\" href=\"#disable-execution-cell\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#disable-execution-page\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">disable-execution-page</span></code><a class=\"headerlink\" href=\"#disable-execution-page\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#thebe-remove-input-init\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">thebe-remove-input-init</span></code><a class=\"headerlink\" href=\"#thebe-remove-input-init\" title=\"Link to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
